import {useState, useEffect } from 'react';

const Product = () => {
    const[product, setProducts] = useState([]);
    const categories = [
        {name: "new closthing",api:"https://fakestoreapi.com/products/category/men's clothing"},
        {name: "Best closting",api:"https://fakestoreapi.com/products/category/men's clothing"},
        {name: "Last closting",api:"https://fakestoreapi.com/products/category/men's clothing"},
    ];
    useEffect(() => {
        const fetchProducts = async () => {
            try {
                const categoryPromises = categories.map(async (category) => {
                    const response = await fetch(category.api);
                    const data = await response.json();
                    return {
                        category: category.name,
                        products: data.slice(0, 4),
                    };
                });

                const results = await Promise.all(categoryPromises);
                setProducts(results);
            } catch (error) {
                console.error('Error fetching products:', error);
            }
        };

        fetchProducts();
    }, []);

  

  return (
    <div>
            {/* <!-- Product Section Begin --> */}
    <section class="product spad">
        <div class="container">
            <div class="row">
                <div class="col-lg-12">
                    <ul class="filter__controls">
                    <li
                            key={category.name}
                            className={activeFilter === category.name ? 'active' : ''}
                            // onClick={() => handleFilterClick(category.name)}
                            >
                            
                        </li>                        
                    </ul>
                </div>
            </div>
            <div class="row product__filter"> 
                <div class="col-lg-3 col-md-6 col-sm-6 col-md-6 col-sm-6 mix new-arrivals">
                    <div class="product__item">
                        <div class="product__item__pic set-bg" data-setbg="img/product/product-1.jpg">
                            <span class="label">New</span>
                            <ul class="product__hover">
                                <li><a href="#"><img src="img/icon/heart.png" alt=""/></a></li>
                                <li><a href="#"><img src="img/icon/compare.png" alt=""/> <span>Compare</span></a></li>
                                <li><a href="#"><img src="img/icon/search.png" alt=""/></a></li>
                            </ul>
                        </div>
                        <div class="product__item__text">
                            <h6>Piqu√© Biker Jacket</h6>
                            <a href="#" class="add-cart">+ Add To Cart</a>
                            <div class="rating">
                                <i class="fa fa-star-o"></i>
                                <i class="fa fa-star-o"></i>
                                <i class="fa fa-star-o"></i>
                                <i class="fa fa-star-o"></i>
                                <i class="fa fa-star-o"></i>
                            </div>
                            <h5>$67.24</h5>
                            <div class="product__color__select">
                                <label for="pc-1">
                                    <input type="radio" id="pc-1"/>
                                </label>
                                <label class="active black" for="pc-2">
                                    <input type="radio" id="pc-2"/>
                                </label>
                                <label class="grey" for="pc-3">
                                    <input type="radio" id="pc-3"/>
                                </label>
                            </div>
                        </div>
                    </div>
                </div>
            
            </div>
        </div>
    </section>
    {/* <!-- Product Section End --> */}
    </div>
  )
}

export default Product
